// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

/**·
* @title RichShop - Romance of the Three Kingdoms Title Shop
*
*
* Docs: 
*
* Version v1.1.0
*
*/

contract RichShop is ERC1155, AccessControl {
    using SafeMath for uint256;

    bytes32 public constant MINT_ROLE = keccak256("MINT");

    uint256 public constant PCT_BASE = 1e18;

    struct ItemDetail {
        uint256 tokenId; // 货物ID
        bytes32 name; // 名称
        uint8 priceToken; // 支付方式 0: mmc 1: m3t
        uint256 price; // 价格
    }

    uint256 public tokenListLength;
    IERC20 public MMC;
    IERC20 public M3T;
    mapping (uint256 => ItemDetail) public _items;
    address public feeRecipient = 0x8F3b8f3046dEb7C4E227dC0c6379051755Ba3142;

    constructor(address mmc, address m3t) ERC1155 ("Rich Title") {
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        MMC = IERC20(mmc);
        M3T = IERC20(m3t);
        _addItem("ZHJ", 1, 100); //纵横卷 tokenId: 0 //4u
        _addItem("TGL", 1, 200); //太公略 tokenId: 1 //8u
        _addItem("SHJ", 1, 400); //山海经 tokenId: 2 //16u
        _addItem("SGZ", 1, 800); //三国志 tokenId: 3 //32u
        _addItem("Excellent_Gem", 1, 100); //优秀宝石 tokenId: 4 //4u
        _addItem("Epic_Gem", 1, 1250); //史诗宝石 tokenId: 5 //50u
        _addItem("Legend_Gem", 1, 10000); //传说宝石 tokenId: 6 //400u
        _addItem("Break_Gem", 1, 200); //突破宝石 tokenId: 7 //8u
        _addItem("Advanced_Gem", 1, 1250); //进阶宝石 tokenId: 8 //50u
        _addItem("LY_Stone", 1, 500); //两仪石 tokenId: 9 //20u
        _addItem("Drum", 0, 1000); //战鼓 tokenId: 10 // 10u
        _addItem("Forage", 0, 100); //粮草 tokenId: 11 // 1u
    }

    function addItem(bytes32 name, uint8 priceToken, uint256 price) public onlyRole(MINT_ROLE) returns (uint256) {
        require(priceToken == 0 || priceToken == 1);
        return _addItem(name, priceToken, price);
    }

    function _addItem(bytes32 name, uint8 priceToken, uint256 price) internal returns (uint256){
        uint256 tokenId = tokenListLength++;
        _items[tokenId] = ItemDetail(
            tokenId, 
            name,
            priceToken, 
            price.mul(PCT_BASE)
        );
        return tokenId;
    }

    function buy(
        address account, uint256 tokenId, uint256 amount
    ) public {
        require(tokenId < tokenListLength);
        if (_items[tokenId].priceToken == 0) {
            bool success = MMC.transferFrom(msg.sender, feeRecipient, amount.mul(_items[tokenId].price));
            require(success);
        } else if (_items[tokenId].priceToken == 1) {
            bool success = M3T.transferFrom(msg.sender, feeRecipient, amount.mul(_items[tokenId].price));
            require(success);
        } else {
            revert("Price token is invalid");
        }
        _mint(account, tokenId, amount, "");
    }

    function getAllItems() public view returns (ItemDetail[] memory) {
        uint256 len = tokenListLength;
        ItemDetail[] memory list = new ItemDetail[](len);
        for (uint256 i = 0; i < len; i++) {
            list[i] = _items[i];
        }
        return list;
    }

    function ownList(address account) public view returns (uint256[] memory) {
        uint256 len = tokenListLength;
        uint256[] memory list = new uint256[](len);
        for (uint256 i = 0; i < len; i++) {
            list[i] = balanceOf(account, i);
        }
        return list;
    }

    function supportsInterface(bytes4 interfaceId) public view virtual
        override(ERC1155, AccessControl) returns (bool) {
        return super.supportsInterface(interfaceId);
    }
}
